require('dotenv').config({path: './.env'});
const { StatusCodes } = require('http-status-codes');
const uuid = require('uuid');

const { uploadObjectsAsync } = require('../../services/file-storage');

const imagesEndpoint = () => {
  return {
    postAsync: async (_) => {
      let statusCode = StatusCodes.CREATED;
      try {
        const images = [];
        images.push({
          key: process.env.FOLDER + '/' + uuid.v4() + '.jpg',
          content: Buffer.from('', 'base64'),
          contentType: 'image/jpg'
        });
      
        await uploadObjectsAsync(images);
      } catch(error) {
        console.log(error);
        statusCode = StatusCodes.INTERNAL_SERVER_ERROR;
      }
      return {
        statusCode: statusCode
      };
    }
  }
};

const imagesController = () => {
  return {
    postAsync: async (body) => {
      return await imagesEndpoint().postAsync(JSON.parse(body));
    }
  }
}

module.exports = imagesController();
